import React, {useEffect} from 'react';
import Nav from '../Components/Nav/Nav';

function Home() {
    useEffect(() => {
        // fetch("/api/lifetimestats", {
        //     body: JSON.stringify({'user' : 'antcliffr12'})
        // })
        //     .then(res => res.json())
        //     .then(result => {
        //         console.log(result.data.user);
        // })
    fetch("/api/lifetimestats", {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        email: 'foo',
        pass: 'bar'
      })
    }).then(response => console.log(response))
    })
    return (
        <>
        <Nav />
        <div className="container">
            <h1>Home Page</h1>
        </div>
        </>
    )
}

export default Home;
